import React from "react";
import { Row, Col } from "reactstrap";

const FoodTruckList = () => {
  return (
    <div className="food-truck-list-container">
      <Row>
        <Col sm={{ size: 6, order: 2, offset: 1 }}>
          .col-sm-6 .order-sm-2 .offset-sm-1
        </Col>
      </Row>
    </div>
  );
};

export default FoodTruckList;
